import axios from 'axios';

 export default async function getDogs() {
    return function(dispatch) {
        let allDogs = axios.get(`http://localhost:3001/dogs`).data
        .then(response => response.json())
        .then(json =>dispatch({
            type:"GET_DOGS",
            payload: json
        }))
        
    }
}
